pragma solidity >=0.4.21 <0.6.0;
// import "openzeppelin-solidity/contracts/access/Roles.sol";

contract TumbulaStore{

    /*
    Contract for the Tumbula online store.

    ------------------------------------
    ROLES.
    1. Admin.
    2. Store Owner.
    ------------------------------------
     */


    address owner;

    uint public storeOwnerNumber;

    struct StoreOwner{
        uint    id;
        string  first_name;
        string  last_name;
        address store_owner_address;
        bool    active;
    }

    mapping(uint => StoreOwner) public storeowners;

    event storeOwnerCreated(
        uint id,
        string first_name,
        string last_name,
        bool active
    );

    constructor() public {
        owner = msg.sender;
        storeOwnerNumber = 1;
    }

    function addStoreOwner(string memory _first_name, string memory _last_name, address _store_owner_address) public returns(bool) {
        storeowners[storeOwnerNumber] = StoreOwner(storeOwnerNumber, _first_name, _last_name, _store_owner_address, true);
        emit storeOwnerCreated(storeOwnerNumber, _first_name, _last_name, true);
        storeOwnerNumber = storeOwnerNumber + 1;
        return true;
    }

}
